class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $k
     * @return Integer
     */
    function maximumScore($nums, $k) {
        $mod = 1e9 + 7;

        // Create a priority queue to store numbers based on their prime score and value
        $pq = new SplPriorityQueue();
        foreach ($nums as $index => $num) {
            $primeScore = $this->getPrimeScore($num);
            // Use negative values to simulate max heap based on prime score and value
            $pq->insert($index, [-$primeScore, -$num]);
        }

        $score = 1;
        $used = array_fill(0, count($nums), false);
        for ($i = 0; $i < $k; $i++) {
            while (!$pq->isEmpty() && $used[$pq->top()]) {
                $pq->extract(); // Remove used elements
            }
            if ($pq->isEmpty()) break;

            $index = $pq->extract();
            $score = ($score * abs($nums[$index])) % $mod;
            $used[$index] = true; // Mark as used
        }

        return $score;
    }

    private function getPrimeScore($num) {
        $score = 0;
        for ($i = 2; $i * $i <= $num; $i++) {
            if ($num % $i == 0) {
                $score++;
                while ($num % $i == 0) {
                    $num /= $i;
                }
            }
        }
        if ($num > 1) $score++;
        return $score;
    }
}
